export class Trip {
  tripName: string;
  startDate: Date;
  endDate: Date;

  constructor(tripname: string, startdate: Date, enddate: Date) {
    this.tripName = tripname;
    this.startDate = startdate;
    this.endDate = enddate;
  }

  disp(): void {
    console.log("Engine is  :   " + this.tripName)
  }
}
export default Trip;
